import json
import time
import uuid
from typing import Dict, List, Optional

from fastapi import Body, HTTPException
from pydantic import BaseModel, Field

# Edit this list later to add/rename games without touching the UI logic.
ARENA_GAMES: List[dict] = [
    {
        "id": "arena_classic",
        "title": "Arena Classic",
        "subtitle": "Komandinis lobby + start (MVP).",
        "tag": "MVP",
        "modes": ["3x3", "5x5"],
    },
    {
        "id": "arena_blitz",
        "title": "Arena Blitz",
        "subtitle": "Greitesnis reimas (WIP).",
        "tag": "WIP",
        "modes": ["3x3", "5x5"],
    },
]

GAMES_JSON = json.dumps(ARENA_GAMES, ensure_ascii=False)

ROOM_TTL_SEC = int(os.getenv("ARENA_ROOM_TTL_SEC", "3600"))  # 1h default
ROOMS: Dict[str, dict] = {}

def _now() -> int:
    return int(time.time())

def _new_room_id() -> str:
    return uuid.uuid4().hex[:10]

def _gc_rooms() -> None:
    """Best-effort cleanup to avoid unbounded memory growth on long-lived servers."""
    t = _now()
    dead = []
    for rid, room in ROOMS.items():
        last = int(room.get("updated_at", 0) or 0)
        if last and (t - last) > ROOM_TTL_SEC:
            dead.append(rid)
    for rid in dead:
        ROOMS.pop(rid, None)

class CreateRoomIn(BaseModel):
    game_id: str = Field(..., min_length=1, max_length=64)
    mode: str = Field(..., min_length=3, max_length=16)

class JoinRoomIn(BaseModel):
    nickname: str = Field(..., min_length=1, max_length=64)

