@app.post("/api/rooms")
async def api_create_room(payload: CreateRoomIn = Body(...)):
    _gc_rooms()

    game = next((g for g in ARENA_GAMES if g["id"] == payload.game_id), None)
    if not game:
        raise HTTPException(status_code=400, detail="Unknown game_id")

    if payload.mode not in (game.get("modes") or []):
        raise HTTPException(status_code=400, detail="Unsupported mode")

    rid = _new_room_id()
    ROOMS[rid] = {
        "room_id": rid,
        "game_id": payload.game_id,
        "game_title": game.get("title", payload.game_id),
        "mode": payload.mode,
        "players": [],
        "created_at": _now(),
        "updated_at": _now(),
    }
    return {"room_id": rid, "url": f"/r/{rid}"}

@app.get("/r/{room_id}", response_class=HTMLResponse)
async def room_page(room_id: str):
    _gc_rooms()
    if room_id not in ROOMS:
        raise HTTPException(status_code=404, detail="Room not found")

    html = ROOM_HTML.replace("__ARENA_LOGO__", ARENA_LOGO).replace("__ROOM_ID__", room_id)
    return HTMLResponse(html)

@app.get("/api/rooms/{room_id}")
async def api_room(room_id: str):
    _gc_rooms()
    room = ROOMS.get(room_id)
    if not room:
        raise HTTPException(status_code=404, detail="Room not found")
    return room

@app.post("/api/rooms/{room_id}/join")
async def api_join_room(room_id: str, payload: JoinRoomIn = Body(...)):
    _gc_rooms()
    room = ROOMS.get(room_id)
    if not room:
        raise HTTPException(status_code=404, detail="Room not found")

    nickname = payload.nickname.strip()
    if len(nickname) > 24:
        nickname = nickname[:24]

    player_id = uuid.uuid4().hex[:10]
    room["players"].append({"player_id": player_id, "nickname": nickname})
    room["updated_at"] = _now()
    return {"player_id": player_id}


@app.get("/", response_class=HTMLResponse)
async def home():
    return HTML.replace("__ARENA_LOGO__", ARENA_LOGO).replace("__GAMES_JSON__", GAMES_JSON)

@app.get("/health", response_class=PlainTextResponse)
async def health():
    return PlainTextResponse("ok")
